INSERT INTO `about` (`id`, `title_en`, `title_ar`, `text_en`, `text_ar`, `image`, `banner`, `created_at`, `updated_at`) VALUES
(1, 'About Penguin', 'عن بنجوين', '<p><strong>Penguin is an Egyptian company founded in 2000</strong><br>Penguin Air Conditioning Company was founded by accountant Khaled Sarhan, who has more than 30 years of experience in the field of refrigeration rooms and air conditioners.</p>\r\n<p>It was established as an extension of the NG Company, located in Port Said Governorate, and it is a leading company in the field of air conditioning and refrigeration since 1982, with the equivalent of 41 years of experience in the field of business.<br>Penguin Company provides integrated and economic solutions for all air conditioning works, including supply, installation, maintenance, equipment, technical studies, engineering drawings (splits, central &amp; chillers), and cooling and freezing works (wards &amp; tunnels).<br>It was established as an extension of the NG Company, located in Port Said Governorate, and it is a leading company in the field of air conditioning and refrigeration since 1982, with the equivalent of 41 years of experience in the field of business.<br>Penguin Company provides integrated and economic solutions for all air conditioning works, including supply, installation, maintenance, equipment, technical studies, engineering drawings (splits, central &amp; chillers), and cooling and freezing works (wards &amp; tunnels).</p>', '<h5>بنجوين هي شركة مصرية تأسست عام 2000</h5>\r\n<h4>شركة بنجوين للتكييف أسسها المحاسب خالد سرحان وهو خبرة أكثر من 30 عاما فى مجال اعمال غرف التبريدوالتكييفات</h4>\r\n<p>تم انشائها امتداد لشركه (أن جى) والكائنة فى محافظة بورسعيد ، وهى شركة رائدة فى مجال التكييف والتبريد منذ سنة 1982 بما يعادل 41 سنة من الخبرة فى مجال الأعمال<br>توفر شركه بنجوين حلول متكامله و اقتصاديه لكافه اعمال التكيف وتشمل التوريد و التركيب و الصيانه و التجهيزات و الدراسات الفنيه و الرسومات الهندسيه (اسبليت &amp; مركزى &amp; تشيلرات) واعمال التبريد و التجميد(عنابر&amp;انفاق).<br>تم انشائها امتداد لشركه (أن جى) والكائنة فى محافظة بورسعيد ، وهى شركة رائدة فى مجال التكييف والتبريد منذ سنة 1982 بما يعادل 41 سنة من الخبرة فى مجال الأعمال<br>توفر شركه بنجوين حلول متكامله و اقتصاديه لكافه اعمال التكيف وتشمل التوريد و التركيب و الصيانه و التجهيزات و الدراسات الفنيه و الرسومات الهندسيه (اسبليت &amp; مركزى &amp; تشيلرات) واعمال التبريد و التجميد(عنابر&amp;انفاق).</p>', '82919.jpeg', '24846.jpeg', '2020-10-13 08:39:44', '2024-09-01 12:17:28');
