INSERT INTO `categories` (`id`, `name_en`, `name_ar`, `desc_en`, `link_en`, `link_ar`, `desc_ar`, `image`, `icon`, `banner`, `has_sub`, `parent_id`, `home`, `menu`, `status`, `seen`, `order`, `meta_title_en`, `meta_title_ar`, `meta_desc_en`, `meta_desc_ar`, `meta_robots`, `created_at`, `updated_at`) VALUES
(16, 'خيم', 'tents', '<p>A&nbsp;<strong>tent</strong>&nbsp;is a movable, lightweight&nbsp;<a title=\"Shelter\" href=\"https://simple.wikipedia.org/wiki/Shelter\">shelter</a>&nbsp;which uses&nbsp;<a class=\"mw-redirect\" title=\"Fabric\" href=\"https://simple.wikipedia.org/wiki/Fabric\">fabric</a>&nbsp;to protect people from wind, rain and from the cold. The fabric walls of a tent are supported by wood or metal poles and thin ropes (called \"guy lines\"), and the tent or the ropes are usually attached to the ground with plastic or metal pointed stakes, or lattice frames and internal posts in the cases of&nbsp;<a title=\"Yurt\" href=\"https://simple.wikipedia.org/wiki/Yurt\">yurts</a>&nbsp;and&nbsp;<a title=\"Marquee\" href=\"https://simple.wikipedia.org/wiki/Marquee\">marquees</a>. Tent camping exploded in popularity in the 1960s. Manufacturers introduced poles made of&nbsp;<a title=\"Fiberglass\" href=\"https://simple.wikipedia.org/wiki/Fiberglass\">fiberglass</a>&nbsp;or&nbsp;<a title=\"Aluminium\" href=\"https://simple.wikipedia.org/wiki/Aluminium\">aluminum</a>&nbsp;alloys, allowing for a greater range of shapes and a lighter weight tent to transport. Zippered tent doors replaced the traditional flap opening.<sup id=\"cite_ref-1\" class=\"reference\"><a href=\"https://simple.wikipedia.org/wiki/Tent#cite_note-1\"><span class=\"cite-bracket\">[</span>1<span class=\"cite-bracket\">]</span></a></sup></p>', 'خيم', 'tents', '<div class=\"gtx-body\">الخيمة عبارة عن مأوى متحرك وخفيف الوزن يستخدم القماش لحماية الأشخاص من الرياح والأمطار والبرد. يتم دعم الجدران القماشية للخيمة بأعمدة خشبية أو معدنية وحبال رفيعة (تسمى \"خطوط الشد\")، وعادة ما يتم ربط الخيمة أو الحبال بالأرض بأوتاد مدببة بلاستيكية أو معدنية، أو إطارات شبكية وأعمدة داخلية. حالات الخيام والسرادقات. انتشرت شعبية الخيام في الستينيات. قدم المصنعون أعمدة مصنوعة من الألياف الزجاجية أو سبائك الألومنيوم، مما يسمح بمجموعة أكبر من الأشكال وخيمة خفيفة الوزن للنقل. حلت أبواب الخيمة المزودة بسحاب محل فتحة الرفرف التقليدية.[1]</div>', '37425.jpeg', NULL, NULL, 0, 0, 0, 0, 1, NULL, 1, NULL, NULL, NULL, NULL, 1, '2024-09-08 15:15:43', '2024-09-08 15:15:43'),
(17, 'Chairs', 'الكراسي', '<ol class=\"lpwbZIOD86qFKLHJ2ZfQ E53FcpmOYsLLXxtj5omt\" data-type=\"definition-content-list\">\r\n<li>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<div>a seat, especially for one person, usually having four legs for support and a rest for the back and often having rests for the arms.</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<div>something that serves as a chair or supports like a chair:</div>\r\n</div>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<p><em>The two men clasped hands to make a chair for their injured companion.</em></p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<div>a seat of office or authority.</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<div>a position of authority, as of a judge, professor, etc.</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<div>the person occupying a seat of office, especially the chairperson of a meeting:</div>\r\n</div>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<p><em>The speaker addressed the chair.</em></p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<div>(in an orchestra) the position of a player, assigned by rank;&nbsp;<a href=\"https://www.dictionary.com/browse/desk\">desk</a>:</div>\r\n</div>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<p><em>first clarinet chair.</em></p>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<div><strong>the chair,&nbsp;</strong><em>Informal.&nbsp;</em><a href=\"https://www.dictionary.com/browse/electric-chair\">electric chair</a>.</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<div><a href=\"https://www.dictionary.com/browse/chairlift\">chairlift</a>.</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<div><a href=\"https://www.dictionary.com/browse/sedan-chair\">sedan chair</a>.</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<div>(in reinforced-concrete construction) a device for maintaining the position of reinforcing rods or strands during the pouring operation.</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<div>a glassmaker\'s bench having extended arms on which a blowpipe is rolled in shaping glass.</div>\r\n</div>\r\n</li>\r\n<li>\r\n<div class=\"NZKOFkdkcvYgD3lqOIJw\">\r\n<div><em>British Railroads.&nbsp;</em>a metal block for supporting a rail and securing it to a crosstie or the like.</div>\r\n</div>\r\n</li>\r\n</ol>', 'Chairs', 'الكراسي', '<p>مقعد، خاصة لشخص واحد، وعادة ما يكون له أربع أرجل للدعم ومسند للظهر وغالبًا ما يكون به مساند للذراعين. شيء يعمل ككرسي أو يدعم مثل الكرسي: شبك الرجلان أيديهما ليصنعا كرسيًا لرفيقهما المصاب. مقرًا لمنصب أو سلطة. منصب سلطة، مثل القاضي والأستاذ وما إلى ذلك. الشخص الذي يشغل مقعدًا في المنصب، وخاصة رئيس الاجتماع: المتحدث يخاطب الرئيس. (في الأوركسترا) منصب العازف، حسب رتبته؛ المكتب: كرسي الكلارينيت الأول. الكرسي غير رسمي. كرسي كهربائي. مصعد. كرسي سيدان. (في البناء الخرساني المسلح) جهاز للحفاظ على موضع قضبان أو خيوط التسليح أثناء عملية الصب. منضدة صانع الزجاج لها أذرع ممتدة يتم لف أنبوب النفخ عليها لتشكيل الزجاج. السكك الحديدية البريطانية. كتلة معدنية لدعم السكة وتثبيتها برباط متقاطع أو ما شابه.</p>', '90691.jpeg', NULL, NULL, 1, 0, 0, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-09-08 15:21:43', '2024-09-08 15:28:27'),
(18, 'tables', 'طاولة', NULL, 'tables', 'طاولة', NULL, '41713.jpeg', NULL, NULL, 0, 0, 0, 0, 1, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2024-09-08 15:24:51', '2024-09-08 15:24:51'),
