INSERT INTO `pages` (`id`, `title_en`, `title_ar`, `text_en`, `text_ar`, `link_en`, `link_ar`, `status`, `meta_title_en`, `meta_title_ar`, `meta_desc_en`, `meta_desc_ar`, `meta_robots`, `created_at`, `updated_at`) VALUES
(1, 'Delivery policy', 'سياسة التوصيل', '<ul>\r\n<li>Shipping: within 24 hours</li>\r\n<li>One year brand warranty</li>\r\n<li>Free shipping on all products with a minimum purchase of $50</li>\r\n</ul>\r\n<p><strong>Returns</strong></p>\r\n<p>If you don\'t like the product, you can return it within 15 days - no questions asked. Bodysuits, swimwear and sale items are excluded. We have an easy and hassle-free returns policy. Please see the Delivery and Returns section for more information.</p>\r\n<p>Help<br>Contact us if you have any other questions or concerns.<br>Email: contact@example.com<br>Phone: (+40) 123 456 7</p>', '<ul class=\"checkmark-info mb-3\">\r\n<li>الشحن: في غضون 24 ساعة</li>\r\n<li>ضمان العلامة التجارية لمدة عام واحد</li>\r\n<li>شحن مجاني لجميع المنتجات عند الشراء بحد أدنى قدره 50 دولارًا</li>\r\n</ul>\r\n<h4 class=\"pt-1\">الإرجاعات</h4>\r\n<p>ذا لم يعجبك المنتج، يمكنك إرجاعه في غضون 15 يومًا - دون أي أسئلة. يستثنى من ذلك أزياء البودي سوت وملابس السباحة والعناصر المشمولة في تنزيلات البيع. لدينا سياسة إرجاع سهلة وخالية من المتاعب. يرجى الاطلاع على قسم التسليم والإرجاع لمزيد من المعلومات.</p>\r\n<h4 class=\"pt-1\">المساعدة</h4>\r\n<ul class=\"list-info\">\r\n<li>اتصل بنا إذا كان لديك أي أسئلة أو مخاوف أخرى.</li>\r\n<li class=\"my-1\">البريد الإلكتروني: <a href=\"mailto:contact@example.com\" target=\"_new\">contact@example.com</a></li>\r\n<li>الهاتف: (+40) 123 456 7</li>\r\n</ul>', 'Delivery-policy', 'سياسة-التوصيل', 1, NULL, NULL, NULL, NULL, NULL, '2023-11-26 08:10:41', '2024-03-25 10:32:35');
